import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
      <form>
      <label>
      <input type="checkbox" name="name" />
      Item 1
      </label>
      </form>
      </body>
    </div>
  );
}

export default App;
